pragma solidity ^0.5.3;

import "./ArbProtocol.sol";
import "./ArbValue.sol";
import "./IChallengeManager.sol";
import "./ArbBalanceTracker.sol";
import "./MerkleLib.sol";

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";

contract VMTracker is Ownable {
	using SafeMath for uint256;
    using BytesLib for bytes;

    event MessageDelivered(
        bytes32 indexed vmId,
        bytes32 destination,
        bytes21 tokenType,
        uint256 value,
        bytes data
    );

    event VMCreated(
        uint32 _gracePeriod, 
        uint128 _escrowRequired, 
        uint32 _maxExecutionSteps,
        bytes32 _vmId, 
        bytes32 _vmState,
        uint16 _challengeManagerNum,
        address[] managers
    );

    event ProposedUnanimousAssertion (
        bytes32 indexed vmId,
        bytes32 unanHash,
        uint64 sequenceNum
    );

    event ConfirmedUnanimousAssertion (
        bytes32 indexed vmId,
        uint64 sequenceNum
    );

    event FinalUnanimousAssertion(
        bytes32 indexed vmId,
        bytes32 unanHash
    );

    // fields:
    // beforeHash
    // beforeInbox
    // afterHash
    //

    event DisputableAssertion (
        bytes32 indexed vmId,
        bytes32[3] fields,
        address asserter,
        uint64[2] timeBounds,
        bytes21[] tokenTypes,
        uint32 numSteps,
        bytes32 lastMessageHash,
        bytes32 logsHash,
        uint256[] amounts
    );

    event ConfirmedAssertion(
        bytes32 indexed vmId,
        bytes32 newState
    );

    enum VMState {
        Waiting,
        PendingAssertion,
        PendingUnanimous
    }

    struct VM {
        bytes32 machineHash;
        bytes32 disputableHash; // Disputable assert only
        bytes32 inboxHash;
        bytes32 pendingMessages;
        bytes32 managerRoot;
        bytes32 exitAddress;
        bytes32 terminateAddress;
        uint256 lastPaidHeight;
        uint256 validatorFee;
        uint256 funding; 
        uint128 escrowRequired;
        uint64 deadline;
        uint64 sequenceOrAsserterNum;
        uint32 gracePeriod;
        uint32 maxExecutionSteps;
        uint16 managerCount;
        uint16 challengeManagersNum;
        VMState state;
        bool inChallenge;
        mapping(uint => uint256) managerBalances;
    }

    IChallengeManager[] challengeManagers;
    ArbBalanceTracker arbBalanceTracker;
    mapping(bytes32 => VM) vms;
    uint feePerBlock;

    constructor(address _balanceTrackerAddress) public {
        arbBalanceTracker = ArbBalanceTracker(_balanceTrackerAddress);
    }

    function _paymentPerBlock(VM storage _vm) internal view returns (uint) {
        return _vm.escrowRequired / (feePerBlock + _vm.validatorFee * _vm.managerCount);
    }

    function _paymentRequired(VM storage _vm) internal view returns (uint) {
        return (block.number - _vm.lastPaidHeight) * _paymentPerBlock(_vm);
    }

    function addChallengeManager(IChallengeManager _challengeManager) onlyOwner public {
        challengeManagers.push(_challengeManager);
    }

    function withinTimeBounds(uint64[2] memory _timeBounds) public view returns (bool) {
        return block.number >= _timeBounds[0] && block.number <= _timeBounds[1];
    }

    function _resetDeadline(VM storage _vm) internal {
        _vm.deadline = uint64(block.number) + _vm.gracePeriod;
    }

    function _acceptAssertion(
        bytes32 _vmId,
        bytes32 _afterHash,
        bytes21[] memory _tokenTypes,
        bytes memory _messageData,
        uint16[] memory _tokenTypeNum,
        uint256[] memory _amounts,
        bytes32[] memory _destinations
    ) internal {
        uint offset = 0;
        bytes memory msgData;
        VM storage vm = vms[_vmId];
        for (uint i = 0; i < _amounts.length; i++) {
            (offset, msgData) = ArbValue.get_next_valid_value(_messageData, offset);
            _sendUnpaidMessage(
                _destinations[i],
                _tokenTypes[_tokenTypeNum[i]],
                _amounts[i],
                _vmId,
                msgData
            );
        }

        vm.machineHash = _afterHash;
        vm.state = VMState.Waiting;

        if (vm.pendingMessages != ArbValue.hashEmptyTuple()) {
            vm.inboxHash = ArbProtocol.appendInboxMessages(vm.inboxHash, vm.pendingMessages);
            vm.pendingMessages = ArbValue.hashEmptyTuple();
        }
    }



    // fields2
    // _gracePeriod
    // _maxExecutionSteps
    // _challengeManagerNum

    function createVm(
        bytes32 _vmId,
        bytes32 _vmState,
        bytes32 _createHash,
        uint32 _gracePeriod,
        uint32 _maxExecutionSteps,
        uint16 _challengeManagerNum,
        uint128 _escrowRequired,
        bytes memory _signatures
    ) public {
        require(_signatures.length / 65 < 2 ** 16, "Too many managers");
        require(bytes32(bytes20(_vmId)) != _vmId, "Invalid vmId");
        require(_challengeManagerNum < challengeManagers.length, "Invalid challenge manager num");

        address[] memory assertKeys = ArbProtocol.recoverAddresses(_createHash, _signatures);
        require(_createHash == ArbProtocol.createVMHash(
            _gracePeriod,
            _escrowRequired,
            _maxExecutionSteps,
            _vmState,
            _challengeManagerNum,
            assertKeys
        ), "Create data incorrect");

        // for (uint i = 0; i < assertKeys.length; i++) {
        //     arbBalanceTracker.removeToken(
        //         bytes32(bytes20(assertKeys[i])),
        //         address(arbBalanceTracker),
        //         _escrowRequired
        //     );
        // }
        VM storage vm = vms[_vmId];
        vm.machineHash = _vmState;
        vm.disputableHash = 0;
        vm.inboxHash = ArbValue.hashEmptyTuple();
        vm.pendingMessages = ArbValue.hashEmptyTuple();
        vm.managerRoot = MerkleLib.generateAddressRoot(assertKeys);
        vm.lastPaidHeight = block.number;
        vm.escrowRequired = _escrowRequired;
        vm.gracePeriod = _gracePeriod;
        vm.maxExecutionSteps = _maxExecutionSteps;
        vm.managerCount = uint16(assertKeys.length);
        vm.challengeManagersNum = _challengeManagerNum;
        vm.state = VMState.Waiting;

        for (uint i = 0; i < assertKeys.length; i++) {
            vm.managerBalances[i] = _escrowRequired;
        }

        emit VMCreated(
            _gracePeriod,
            _escrowRequired,
            _maxExecutionSteps,
            _vmId,
            _vmState,
            _challengeManagerNum,
            assertKeys
        );
    }

    function sendMessage(bytes32 _destination, bytes21 _tokenType, uint256 _amount, bytes memory _data) public {
        _sendUnpaidMessage(
            _destination,
            _tokenType,
            _amount,
            bytes32(bytes20(msg.sender)),
            _data
        );
    }

    function sendEthMessage(bytes32 _destination, bytes memory _data) public payable {
        arbBalanceTracker.depositEth.value(msg.value)(_destination);
        _deliverMessage(
            _destination,
            bytes21(0),
            msg.value,
            bytes32(bytes20(msg.sender)),
            _data
        );
    }

    function _sendUnpaidMessage(bytes32 _destination, bytes21 _tokenType, uint256 _value, bytes32 _sender, bytes memory _data) internal {
        if(_tokenType[20] == 0x01) {
            arbBalanceTracker.transferNFT(_sender, _destination, address(bytes20(_tokenType)), _value);
        } else {
            arbBalanceTracker.transferToken(_sender, _destination, address(bytes20(_tokenType)), _value);
        }
        _deliverMessage(_destination, _tokenType, _value, _sender, _data);
    }

    function _deliverMessage(bytes32 _destination, bytes21 _tokenType, uint256 _value, bytes32 _sender, bytes memory _data) internal {
        if (bytes32(bytes20(_destination)) != _destination) {
            VM storage vm = vms[_destination];
            bytes32 messageHash = ArbProtocol.generateSentMessageHash(
                _destination,
                ArbValue.deserialize_value_hash(_data),
                _tokenType,
                _value,
                _sender
            );
            vm.pendingMessages = ArbProtocol.appendInboxPendingMessage(
                vm.pendingMessages,
                messageHash
            );
        }

        emit MessageDelivered(
            _destination,
            _sender,
            _tokenType,
            _value,
            _data
        );
    }

    function _cancelCurrentState(VM storage vm) internal {
        if (vm.state != VMState.Waiting) {
            require(block.number <= vm.deadline);
        }

        if (vm.state == VMState.PendingAssertion) {
            // If there is a pending disputable assertion, cancel it
            vm.managerBalances[vm.sequenceOrAsserterNum] = vm.managerBalances[vm.sequenceOrAsserterNum].add(vm.escrowRequired);
        }
    }

    struct unanimousAssertData {
        bytes32 vmId;
        bytes32 afterHash;
        bytes32 logsHash;
        bytes32 newInbox;
        uint64[2] timeBounds;
        bytes21[] tokenTypes;
        bytes messageData;
        uint16[] messageTokenNum;
        uint256[] messageAmount;
        bytes32[] messageDestination;
        bytes signatures;
    }

    function unanimousAssert(
        bytes32 _vmId,
        bytes32 _afterHash,
        bytes32 _newInbox,
        bytes32 _logsHash,
        uint64[2] memory _timeBounds,
        bytes21[] memory _tokenTypes,
        bytes memory _messageData,
        uint16[] memory _messageTokenNum,
        uint256[] memory _messageAmount,
        bytes32[] memory _messageDestination,
        bytes memory _signatures
    ) public {
        unanimousAssertImpl(unanimousAssertData(
            _vmId,
            _afterHash,
            _logsHash,
            _newInbox,
            _timeBounds,
            _tokenTypes,
            _messageData,
            _messageTokenNum,
            _messageAmount,
            _messageDestination,
            _signatures
        ));
    }

    function unanimousAssertImpl(unanimousAssertData memory data) internal {
        VM storage vm = vms[data.vmId];
        require(withinTimeBounds(data.timeBounds), "Precondition: not within time bounds");
        bytes32 unanHash = keccak256(abi.encodePacked(
            data.vmId,
            vm.machineHash,
            vm.inboxHash,
            data.afterHash,
            data.logsHash,
            data.newInbox,
            data.timeBounds,
            data.tokenTypes,
            data.messageData,
            data.messageTokenNum,
            data.messageAmount,
            data.messageDestination
        ));
        require(MerkleLib.generateAddressRoot(
            ArbProtocol.recoverAddresses(unanHash, data.signatures)
        ) == vm.managerRoot, "Manager signatures don't match");

        _cancelCurrentState(vm);
        vm.state = VMState.Waiting;
        vm.inboxHash = data.newInbox;
        _acceptAssertion(
            data.vmId,
            data.afterHash,
            data.tokenTypes,
            data.messageData,
            data.messageTokenNum,
            data.messageAmount,
            data.messageDestination
        );

        emit FinalUnanimousAssertion(
            data.vmId,
            unanHash
        );
    }

    function proposeUnanimousAssert(
        bytes32 _vmId,
        bytes32 _unanRest,
        uint64 _sequenceNum,
        uint64[2] memory _timeBounds,
        bytes21[] memory _tokenTypes,
        uint16[] memory _messageTokenNum,
        uint256[] memory _messageAmount,
        bytes memory _signatures
    ) public {
        VM storage vm = vms[_vmId];
        require(withinTimeBounds(_timeBounds), "Precondition: not within time bounds");
        bytes32 unanHash = keccak256(abi.encodePacked(
            _vmId,
            _unanRest,
            _sequenceNum,
            _timeBounds,
            vm.machineHash,
            vm.inboxHash,
            _tokenTypes,
            _messageTokenNum,
            _messageAmount
        ));
        require(MerkleLib.generateAddressRoot(
            ArbProtocol.recoverAddresses(unanHash, _signatures)
        ) == vm.managerRoot, "Manager signatures don't match");

        if (vm.state == VMState.PendingUnanimous) {
            require(_sequenceNum > vm.sequenceOrAsserterNum);
        }

        arbBalanceTracker.hasFunds(
            _vmId,
            _tokenTypes,
            ArbProtocol.calculateBeforeValues(
                _tokenTypes,
                _messageTokenNum,
                _messageAmount
            )
        );

        _cancelCurrentState(vm);
        _resetDeadline(vm);

        vm.state = VMState.PendingUnanimous;
        vm.sequenceOrAsserterNum = _sequenceNum;
        vm.disputableHash = keccak256(abi.encodePacked(
            _tokenTypes,
            _messageTokenNum,
            _messageAmount,
            _unanRest
        ));

        emit ProposedUnanimousAssertion(
            _vmId,
            unanHash,
            _sequenceNum
        );
    }

    function ConfirmUnanimousAsserted(
        bytes32 _vmId,
        bytes32 _afterHash,
        bytes32 _logsHash,
        bytes32 _newInbox,
        bytes21[] memory _tokenTypes,
        bytes memory _messageData,
        uint16[] memory _messageTokenNum,
        uint256[] memory _messageAmount,
        bytes32[] memory _messageDestination
    ) public {
        VM storage vm = vms[_vmId];
        require(vm.state == VMState.PendingUnanimous);
        require(block.number > vm.deadline);
        require(vm.disputableHash == keccak256(abi.encodePacked(
            _tokenTypes,
            _messageTokenNum,
            _messageAmount,
            keccak256(abi.encodePacked(
                _newInbox,
                _afterHash,
                _logsHash,
                _messageData,
                _messageDestination
            ))
        )));

        vm.inboxHash = _newInbox;
        _acceptAssertion(
            _vmId,
            _afterHash,
            _tokenTypes,
            _messageData,
            _messageTokenNum,
            _messageAmount,
            _messageDestination
        );

        emit ConfirmedUnanimousAssertion(
            _vmId,
            vm.sequenceOrAsserterNum
        );
    }



    // fields:
    // _vmId
    // _beforeHash
    // _beforeInbox
    // _afterHash
    // _logsHash

    function disputableAssert(
        bytes32[5] memory _fields,
        uint16 _asserterNum,
        uint32 _numSteps,
        uint64[2] memory timeBounds,
        bytes memory _asserterProof,
        bytes21[] memory _tokenTypes,
        bytes32[] memory _messageDataHash,
        uint16[] memory _messageTokenNum,
        uint256[] memory _msgAmount,
        bytes32[] memory _msgDestination
    ) public {
        return disputableAssertImpl(DisputableAssertData(
            _fields[0],
            _fields[1],
            _fields[2],
            _fields[3],
            _fields[4],
            _asserterNum,
            _numSteps,
            timeBounds,
            _asserterProof,
            _tokenTypes,
            _messageDataHash,
            _messageTokenNum,
            _msgAmount,
            _msgDestination
        ));
    }

    struct DisputableAssertData {
        bytes32 vmId;
        bytes32 beforeHash;
        bytes32 beforeInbox;
        bytes32 afterHash;
        bytes32 logsHash;
        uint16 asserterNum;
        uint32 numSteps;
        uint64[2] timeBounds;
        bytes asserterProof;
        bytes21[] tokenTypes;
        bytes32[] messageDataHash;
        uint16[] messageTokenNum;
        uint256[] msgAmount;
        bytes32[] msgDestination;
    }

    function disputableAssertImpl(DisputableAssertData memory _data) internal {
        VM storage vm = vms[_data.vmId];

        require(vm.state == VMState.Waiting, "Can only disputable assert from waiting state");
        require(!vm.inChallenge);
        require(vm.escrowRequired <= vm.managerBalances[_data.asserterNum], "Manager does not have required escrow");
        require(_data.asserterNum < vm.managerCount, "Invalid manager num");
        require(MerkleLib.verifyProof(
            _data.asserterProof,
            vm.managerRoot,
            bytes32(bytes20(msg.sender)),
            _data.asserterNum + 1
        ), "Incorrect manager key proof");
        require(_data.numSteps <= vm.maxExecutionSteps, "Tried to execute too many steps");
        require(withinTimeBounds(_data.timeBounds), "Precondition: not within time bounds");
        require(_data.beforeHash == vm.machineHash, "Precondition: state hash does not match");
        require(
            _data.beforeInbox == vm.inboxHash ||
            _data.beforeInbox == ArbProtocol.appendInboxMessages(vm.inboxHash, vm.pendingMessages)
        , "Precondition: inbox does not match");

        uint256[] memory beforeBalances = ArbProtocol.calculateBeforeValues(
            _data.tokenTypes,
            _data.messageTokenNum,
            _data.msgAmount
        );

        arbBalanceTracker.hasFunds(
            _data.vmId,
            _data.tokenTypes,
            beforeBalances
        );
        _resetDeadline(vm);

        bytes32 lastMessageHash = ArbProtocol.generateLastMessageHashStub(
            _data.tokenTypes,
            _data.messageDataHash,
            _data.messageTokenNum,
            _data.msgAmount,
            _data.msgDestination
        );

        vm.disputableHash = keccak256(abi.encodePacked(
            keccak256(abi.encodePacked(
                ArbProtocol.generatePreconditionHash(
                    _data.beforeHash,
                    _data.timeBounds,
                    _data.beforeInbox,
                    _data.tokenTypes,
                    beforeBalances
                ),
                ArbProtocol.generateAssertionHash(
                    _data.afterHash,
                    _data.numSteps,
                    0x00,
                    lastMessageHash,
                    0x00,
                    _data.logsHash,
                    beforeBalances
                )
            )),
            msg.sender
        ));
        vm.managerBalances[vm.sequenceOrAsserterNum] = vm.managerBalances[vm.sequenceOrAsserterNum].sub(vm.escrowRequired);
        vm.sequenceOrAsserterNum = uint64(_data.asserterNum);
        vm.state = VMState.PendingAssertion;

        emit DisputableAssertion(
            _data.vmId,
            [_data.beforeHash, _data.beforeInbox, _data.afterHash],
            msg.sender,
            _data.timeBounds,
            _data.tokenTypes,
            _data.numSteps,
            lastMessageHash,
            _data.logsHash,
            beforeBalances
        );
    }

    // fields:
    // _vmId
    // _preconditionHash
    // _afterHash
    // _logsHash

    struct confirmAssertedData{
        bytes32 vmId;
        bytes32 preconditionHash;
        bytes32 afterHash;
        bytes32 logsHash;
        address asserterKey;
        uint32  numSteps;
        bytes21[] tokenTypes;
        bytes messageData;
        uint16[] messageTokenNums;
        uint256[] messageAmounts;
        bytes32[] messageDestination;
    }

    function confirmAsserted(
        bytes32 _vmId,
        bytes32 _preconditionHash,
        bytes32 _afterHash,
        bytes32 _logsHash,
        address _asserterKey,
        uint32 _numSteps,
        bytes21[] memory _tokenTypes,
        bytes memory _messageData,
        uint16[] memory _messageTokenNums,
        uint256[] memory _messageAmounts,
        bytes32[] memory _messageDestination
    ) public {
        return confirmAssertedImpl(confirmAssertedData(
            _vmId,
            _preconditionHash,
            _afterHash,
            _logsHash,
            _asserterKey,
            _numSteps,
            _tokenTypes,
            _messageData,
            _messageTokenNums,
            _messageAmounts,
            _messageDestination
        ));
    }

    function confirmAssertedImpl(confirmAssertedData memory _data) internal {
        VM storage vm = vms[_data.vmId];
        require(vm.state == VMState.PendingAssertion, "VM does not have assertion pending");
        require(block.number > vm.deadline, "Assertion is still pending challenge");
        require(
            keccak256(abi.encodePacked(
                keccak256(abi.encodePacked(
                    _data.preconditionHash,
                    ArbProtocol.generateAssertionHash(
                        _data.afterHash,
                        _data.numSteps,
                        0x00,
                        ArbProtocol.generateLastMessageHash(
                            _data.tokenTypes,
                            _data.messageData,
                            _data.messageTokenNums,
                            _data.messageAmounts,
                            _data.messageDestination
                        ),
                        0x00,
                        _data.logsHash,
                        ArbProtocol.calculateBeforeValues(
                            _data.tokenTypes,
                            _data.messageTokenNums,
                            _data.messageAmounts
                        )
                    )
                )),
                _data.asserterKey
            )) == vm.disputableHash,
            "Precondition and assertion do not match pending assertion"
        );
        vm.managerBalances[vm.sequenceOrAsserterNum] = vm.managerBalances[vm.sequenceOrAsserterNum].add(vm.escrowRequired);
        _acceptAssertion(
            _data.vmId,
            _data.afterHash,
            _data.tokenTypes,
            _data.messageData,
            _data.messageTokenNums,
            _data.messageAmounts,
            _data.messageDestination
        );

        emit ConfirmedAssertion(
            _data.vmId,
            _data.afterHash
        );
    }

    event InitiatedChallenge(
        bytes32 indexed vmId,
        address challenger
    );

    // fields
    // _vmId
    // _assertionHash

    function initiateChallenge(
        bytes32 _vmId,
        bytes32 _assertPreHash,
        address _asserterKey,
        uint16 _challengerNum,
        bytes memory _challengerProof
    ) public {
        require(msg.sender != _asserterKey, "Challenge was created by asserter");

        VM storage vm = vms[_vmId];
        require(block.number <= vm.deadline, "Challenge did not come before deadline");
        require(vm.state == VMState.PendingAssertion, "Assertion must be pending to initiate challenge");
        require(_challengerNum < vm.managerCount, "Challenger num must be for a valid manager");
        require(MerkleLib.verifyProof(
            _challengerProof,
            vm.managerRoot,
            bytes32(bytes20(msg.sender)),
            _challengerNum + 1
        ), "Invalid manager proof");
        require(vm.escrowRequired <= vm.managerBalances[_challengerNum], "Challenger did not have enough escrowed");

        require(
            keccak256(abi.encodePacked(_assertPreHash, _asserterKey))
            == vm.disputableHash,
            "Precondition and assertion do not match pending assertion"
        );

        vm.managerBalances[_challengerNum] = vm.managerBalances[_challengerNum].sub(vm.escrowRequired);
        vm.disputableHash = 0;
        vm.state = VMState.Waiting;
        vm.inChallenge = true;

        challengeManagers[vm.challengeManagersNum].initiateChallenge(
            _vmId,
            [_asserterKey, msg.sender],
            [uint16(vm.sequenceOrAsserterNum), _challengerNum],
            [vm.escrowRequired, vm.escrowRequired],
            vm.gracePeriod,
            _assertPreHash
        );
        emit InitiatedChallenge(
            _vmId,
            msg.sender
        );
    }


    function completeChallenge(bytes32 _vmId, uint16[2] calldata _playerNums, uint128[2] calldata _rewards) external {
        VM storage vm = vms[_vmId];
        require(msg.sender == address(challengeManagers[vm.challengeManagersNum]));
        require(vm.inChallenge);

        vm.inChallenge = false;
        vm.managerBalances[_playerNums[0]] = vm.managerBalances[_playerNums[0]].add(_rewards[0]);
        vm.managerBalances[_playerNums[1]] = vm.managerBalances[_playerNums[1]].add(_rewards[1]);
    }
}
